import React from 'react';
import Link from 'next/link';

const NoticeList = (props) => {

    // const props = lists.map(
    //     list => <Link href={{pathname:'/noticeInfo', query:{NTC_ID:list.NTC_ID}}}><li key={list.NTC_ID}>{list.NTC_TITLE}</li></Link>
    // );

    return (
        <>
            <div>
                {props && props.map(list => (
                    <>
                        <Link href={{pathname:'/noticeInfo', query:{NTC_ID:list.NTC_ID}}}><li key={list.NTC_ID}>{list.NTC_TITLE}</li></Link>
                    </>
                ))}
            </div>
        </>
    )

    // return (
    //     <Link href='/noticeDetail'><li key={props.props.NTC_ID}>{props.props.NTC_TITLE}</li></Link>
    // )
};

export default NoticeList;
